import React, { useEffect, useState } from 'react'

function App() {

  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/json")
      .then(
        response => response.json())
      .then(
        data => {
          setBackendData(data)
        });
    console.log("fetch successful");
  }, []);


  return (
    <div>
      {(typeof backendData.passwords === 'undefined') ? (
        <p>Loading ...</p>
      ) : (
        backendData.passwords.map((password, i) => (
          <p key={i}>{password}</p>
        ))
      )}
    </div>
  )
}

export default App
